import './App.css';
// import axios from 'axios';

const categoryList = ['전체', '정치', '경제', '연예', '스포츠', '사회', '생활/문화', '세계', 'IT/과학', '기타' ];

function App() {
  return (
    <div>
      {categoryList.map(item => {
        return <div className="category">{item}</div>
      })}
    </div>
  );
}

export default App;
